class Solution(object):
    def minimumCost(self, source, target, original, changed, cost):
        from collections import defaultdict
        dp = defaultdict(lambda: float('inf'))
        dp[0, source] = 0

        for i in range(len(source)):
            dp_new = defaultdict(lambda: float('inf'))
            for (j, cur_source), cur_cost in dp.items():
                if j > i:
                    continue
                if cur_source[i] == target[i]:
                    dp_new[j, cur_source] = min(dp_new[j, cur_source], cur_cost)
                for k in range(len(original)):
                    if i + len(original[k]) <= len(source) and cur_source[i:i+len(original[k])] == original[k] and cur_source[:i] + changed[k] + cur_source[i+len(original[k]):] == cur_source[:i] + target[i:i+len(original[k])] + cur_source[i+len(original[k]):]:
                        new_source = cur_source[:i] + changed[k] + cur_source[i+len(original[k]):]
                        dp_new[i+len(original[k]), new_source] = min(dp_new[i+len(original[k]), new_source], cur_cost + cost[k])
            dp = dp_new

        result = float('inf')
        for key, value in dp.items():
            if key[1] == target:
                result = min(result, value)

        return result if result != float('inf') else -1
